svg.script:
function get_xy(evt)
{
  x = evt.clientX + window.pageXOffset -5;
  y = evt.clientY + window.pageYOffset -5;

  evt.target.ownerDocument.getElementById("ball").setAttribute("cx", x + 5);
  evt.target.ownerDocument.getElementById("ball").setAttribute("cy", y + 5);
  android.setXY(x, y)
}

function setPoint(x, y, color)
{
  document.getElementById("point").setAttribute("cx", x + 5);
  document.getElementById("point").setAttribute("cy", y + 5);
  document.getElementById("point").setAttribute("fill", color);
}

function setBlePoint(x, y, color)
{
  document.getElementById("ble_point").setAttribute("cx", x + 5);
  document.getElementById("ble_point").setAttribute("cy", y + 5);
  document.getElementById("ble_point").setAttribute("fill", color);
}
